Similar to the other &quot;The End&quot; series by Marvel, Alan Davis and Mark Farmer examine a possible future in which the Fantastic Four disband, then are forced to re-unite under dire circumstances. This torrent contains all 6 issues of the minseries along with the &quot;Rough Cut&quot; special. The main issues are digital via Minutemen-Phd and the one-shot is thanks to Bchry-DCP. Please seed and enjoy! :-)
